// src/pages/CodeAssessment.js
import React, { useState } from 'react';
import styled from 'styled-components';
import { TextField, Checkbox, FormControlLabel, Button, Container, Typography, Grid } from '@mui/material';
import { motion } from 'framer-motion'; // Correct import
import Tilt from 'react-parallax-tilt'; // Correct import

const AssessmentContainer = styled(Container)`
  min-height: 100vh;
  padding: 5rem 10%;
  background: #1a1a1a;
  color: #ffffff;
`;

const FormBox = styled.div`
  background: rgba(255, 255, 255, 0.1);
  padding: 3rem 4rem;
  border-radius: 15px;
  backdrop-filter: blur(10px);
  box-shadow: 0 8px 32px 0 rgba(31, 38, 135, 0.37);
`;

const LibrariesGrid = styled(Grid)`
  margin-top: 2rem;
  margin-bottom: 2rem;
`;

const SubmitButton = styled(Button)`
  background-color: #ffae00;
  color: #1a1a1a;
  font-weight: bold;
  padding: 0.8rem 2rem;
  margin-top: 1rem;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #e6b800;
  }
`;

const CodeAssessment = () => {
  const [selectedLibraries, setSelectedLibraries] = useState({});
  const [code, setCode] = useState('');

  const librariesList = [
    'Airflow', 'Apache Spark', 'Docker', 'Flowise', 'Hadoop', 'KubeFlow', 'LangChain',
    'LlamaIndex', 'Machine Learning Model Exploit', 'MLflow', 'Model Poisoning', 'NumPy',
    'Ollama', 'ONNX', 'Oracle E-Business', 'Pandas', 'Pytorch', 'Redis', 'Sagemaker',
    'SAP HANA', 'scikit-learn', 'SQL Azure', 'TensorFlow', 'Vector DB'
  ];

  const handleCheckboxChange = (e) => {
    const { name, checked } = e.target;
    setSelectedLibraries({
      ...selectedLibraries,
      [name]: { checked, version: selectedLibraries[name]?.version || '' }
    });
  };

  const handleVersionChange = (e, library) => {
    setSelectedLibraries({
      ...selectedLibraries,
      [library]: { ...selectedLibraries[library], version: e.target.value }
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Prepare data to send to backend
    const librariesUsed = Object.keys(selectedLibraries)
      .filter(lib => selectedLibraries[lib].checked)
      .map(lib => ({ name: lib, version: selectedLibraries[lib].version }));

    const submission = {
      libraries: librariesUsed,
      code
    };

    console.log('Submission:', submission);
    // TODO: Send data to backend
    alert('Code Assessment Submitted Successfully!');
    // Reset form
    setSelectedLibraries({});
    setCode('');
  };

  return (
    <AssessmentContainer>
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <FormBox>
          <Typography variant="h4" align="center" gutterBottom>
            Code Assessment
          </Typography>
          <form onSubmit={handleSubmit}>
            <Typography variant="h6" gutterBottom>
              Select Libraries Used:
            </Typography>
            <LibrariesGrid container spacing={2}>
              {librariesList.map((lib, index) => (
                <Grid item xs={12} sm={6} md={4} key={index}>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={selectedLibraries[lib]?.checked || false}
                        onChange={handleCheckboxChange}
                        name={lib}
                        color="primary"
                      />
                    }
                    label={lib}
                  />
                  {selectedLibraries[lib]?.checked && (
                    <TextField
                      label="Version"
                      variant="outlined"
                      size="small"
                      value={selectedLibraries[lib].version}
                      onChange={(e) => handleVersionChange(e, lib)}
                      style={{ marginTop: '0.5rem', width: '150px' }}
                      required
                    />
                  )}
                </Grid>
              ))}
            </LibrariesGrid>
            <Typography variant="h6" gutterBottom>
              Input Your Code:
            </Typography>
            <TextField
              multiline
              rows={10}
              variant="outlined"
              fullWidth
              value={code}
              onChange={(e) => setCode(e.target.value)}
              required
              placeholder="Paste your code here..."
              style={{ background: '#2a2a2a', borderRadius: '8px' }}
              InputProps={{
                style: { color: '#ffffff' },
              }}
            />
            <SubmitButton type="submit" variant="contained">
              Submit
            </SubmitButton>
          </form>
        </FormBox>
      </motion.div>
    </AssessmentContainer>
  );
};

export default CodeAssessment;
